import { useState } from 'react';
import { Button } from 'antd';

function UseMemo() {
  const [val, setVal] = useState(0);

  return (
    <div className='text-center'>
      <h1>{val}</h1>
      <Button onClick={() => { setVal(Math.round(Math.random() * 10)); }}>Change</Button>
    </div>
  );
}
export default UseMemo;
